						for(var key in ret) {
							item = ret[key]
							retArray.push([
								key,
								item[0],
								item[1],
								item[2],
								item[3],
								item[4],
								item[5],
								item[6],
								item[7],
								item[8],
								[]
							]);
						}
						return retArray;
					}

					var prevSortKey_CUMULATIVE = 1
					var prevSortType_CUMULATIVE = -1
					var maxId_CUMULATIVE = -1
					function Populate_CUMULATIVE(sortKey) {
						var sortType = 1
						if(sortKey == 0) {
							sortType = -1
						}
						if(prevSortKey_CUMULATIVE == sortKey && prevSortType_CUMULATIVE == sortType) {
							sortType *= -1
						}
						prevSortKey_CUMULATIVE = sortKey
						prevSortType_CUMULATIVE = sortType

						elem = document.getElementById("stack_CUMULATIVE")
						bg1 = "#DFDFF2"
						bg2 = "#D3D3E6"
						var s = '<div style="border:1px solid black"><div style="font-weight:bold;border-bottom:1px solid black;" class="gradient">'
						s += '<span class="hoversort" style="width:37%;display:inline-block;text-align:center;" onclick="Populate_CUMULATIVE(0)">Block</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(1)">Inclusive</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(2)">Exclusive</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(3)">Count</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(4)">Inclusive Max</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(5)">Inclusive Min</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(6)">Inclusive Mean</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(7)">Exclusive Max</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(8)">Exclusive Min</span>'
						s += '<span class="hoversort" style="width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;" onclick="Populate_CUMULATIVE(9)">Exclusive Mean</span>'
						s += '</div>'
						var id = 1
						function recurse(oneLevel, depth, parentId) {
							oneLevel = oneLevel.sort(function(a, b) {
								var x = a[sortKey]; var y = b[sortKey];
								return ((x < y) ? 1 : ((x > y) ? -1 : 0)) * sortType;
							});
							for(var i=0; i < oneLevel.length; ++i) {
								var thisId = id;
								id += 1;
								if(thisId %2 == 0) {
									bg1 = "#C8C6F2"
									bg2 = "#B3B1D9"
								}
								else {
									bg1 = "#BDBBE6"
									bg2 = "#A8A7CC"
								}
								s += '<div style="width:100%;overflow:hidden;transition:max-height 0.5s linear" class="CUMULATIVE_Parent_'+parentId+'", id="CUMULATIVE_'+thisId+'">'
								s += '<div style="line-height:22px;"><span style="height:100%;width:37%;display:inline-block;background-color:'+bg1+'" '
								if(oneLevel[i][10].length != 0) {
									s += 'class="hoversort" onclick="HideChildren_CUMULATIVE(\''+thisId+'\')"'
								}
								s += '><span style="width:20px;display:inline-block;margin-left:' + (depth * 15) + 'px;" id="arrow_CUMULATIVE_'+thisId+'">'
								if(oneLevel[i][10].length != 0) {
									s += '&#x25bc;'
								}
								s += '</span>' + oneLevel[i][0] + '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][1])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][1]/totals_CUMULATIVE[0] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg1+'">' + _formatTime(oneLevel[i][2])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][2]/totals_CUMULATIVE[0] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + oneLevel[i][3]
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][3]/totals_CUMULATIVE[1] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg1+'">' + _formatTime(oneLevel[i][4])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][4]/totals_CUMULATIVE[2] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][5])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][5]/totals_CUMULATIVE[3] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][6])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][6]/totals_CUMULATIVE[4] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][7])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][7]/totals_CUMULATIVE[5] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][8])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][8]/totals_CUMULATIVE[6] * 100) + '%;"></div>'
								s += '</span>'
								s += '<span style="height:100%;width:7%;display:inline-block;border-left:1px solid black;margin-left:-1px;text-align:center;background-color:'+bg2+'">' + _formatTime(oneLevel[i][9])
								s += '<div class="percentbar", style="width:' + Math.min(100,oneLevel[i][9]/totals_CUMULATIVE[7] * 100) + '%;"></div>'
								s += '</span></div>'
								recurse(oneLevel[i][10], depth + 1, thisId)
								s += "</div>"
							}
						}
						var datas;
						if(mode_CUMULATIVE == "flat") {
							datas = Flatten_CUMULATIVE();
						}
						else {
							datas = datas_CUMULATIVE;
						}
						recurse(datas, 0, 0)
						s += '</div>'
						elem.innerHTML = s
						for(var i = 0; i < id; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight = Math.max(22, elem.clientHeight) + "px"
								elem.rememberMaxHeight = elem.style.maxHeight
							}
						}
						maxId_CUMULATIVE = id
					}

					function ExpandAll_CUMULATIVE() {
						for(var i = 1; i < maxId_CUMULATIVE; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							arrowElem = document.getElementById("arrow_CUMULATIVE_"+i)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight=elem.rememberMaxHeight
								arrowElem.innerHTML = '&#x25bc;'
							}
						}
						return false;
					}

					function CollapseAll_CUMULATIVE() {
						for(var i = 1; i < maxId_CUMULATIVE; ++i) {
							className = 'CUMULATIVE_Parent_' + i
							elems = document.getElementsByClassName(className)
							arrowElem = document.getElementById("arrow_CUMULATIVE_"+i)
							for(var j = 0; j < elems.length; ++j) {
								var elem = elems[j]
								elem.style.maxHeight='0px'
								arrowElem.innerHTML = '&#x25b6;'
							}
						}
						return false;
					}

					function RenderTreeView_CUMULATIVE() {
						if(mode_CUMULATIVE != "tree") {
							mode_CUMULATIVE = "tree";
							prevSortType_CUMULATIVE *= -1
							Populate_CUMULATIVE(prevSortKey_CUMULATIVE)
							elem = document.getElementById("expandcollapse_CUMULATIVE")
							elem.style.opacity = 100
							elem.style.visibility = "visible"
						}
						return false;
					}

					function RenderFlatView_CUMULATIVE() {
						if(mode_CUMULATIVE != "flat") {
							mode_CUMULATIVE = "flat";
							prevSortType_CUMULATIVE *= -1
							Populate_CUMULATIVE(prevSortKey_CUMULATIVE)
							elem = document.getElementById("expandcollapse_CUMULATIVE")
							elem.style.opacity = 0
							elem.style.visibility = "hidden"
						}
						return false;
					}
			</script>
			<div>
			<div style="border:1px solid black;padding:0px 6px">
				<div style="float:left;transition:opacity 0.5s, visibility 0.5s" id="expandcollapse_CUMULATIVE">
					<a href="javascript:;" onclick="ExpandAll_CUMULATIVE()">expand all</a> |
					<a href="javascript:;" onclick="CollapseAll_CUMULATIVE()">collapse all</a>
				</div>
				&nbsp;
				<div style="float:right">
					View as:
					<a href="javascript:;" onclick="RenderTreeView_CUMULATIVE()">tree</a> |
					<a href="javascript:;" onclick="RenderFlatView_CUMULATIVE()">flat</a>
				</div>
			</div>
			<div style="clear:left" id="stack_CUMULATIVE"></div>
			</div>
			<script type="text/javascript">
				Populate_CUMULATIVE(1);
				setTimeout(function() {
					var height = document.getElementsByTagName("html")[0].scrollHeight + 10;
					console.log("Set height to " + height)
					window.parent.postMessage(["setHeight", height], "*"); 
				}, 1000);
			</script>
		</div>
	</BODY>
</HTML>
